import Item from '../Components/Item';

import React from 'react'

function Weshop({ number }) {
    return (
        <div className="content">
            <div className="img_cs">
                <img className="img_cs" src="https://bosspm.ca/wp-content/uploads/2020/01/coming-soon5.png" alt="img"></img>
            </div>
        </div>
    )
}

export default Weshop;
